import { Grid, Typography } from "@material-ui/core";
import Paper from 'material-ui/Paper';


const styles = {
  paperContainer: {
      backgroundImage: url("https://upload.wikimedia.org/wikipedia/en/thumb/4/41/Flag_of_India.svg/188px-Flag_of_India.svg.png")
  }
};

const Welcome = (props) => {
  return (
    <Paper style={styles.paperContainer}>    
    </Paper>
    /*<Grid
      container
      item
      direction="column"
      alignItems="center"
      justify="center"
      style={{ padding: "30px", minHeight: "93vh" }}
    >
      <Grid item>
        <Typography variant="h2">Welcome to JobBlitz</Typography>
      </Grid>
    </Grid> */
  );
};

export const ErrorPage = (props) => {
  return (
    <Grid
      container
      item
      direction="column"
      alignItems="center"
      justify="center"
      style={{ padding: "30px", minHeight: "93vh" }}
    >
      <Grid item>
        <Typography variant="h2">Error 404</Typography>
      </Grid>
    </Grid>
  );
};

export default Welcome;
